import React, { FC } from 'react'

interface ItemProps {
  _id?: string
  name?: string
  branches?: Array<{}>
  setState: (branches: Array<{}>) => void
}

export const Item: FC<ItemProps> = ({ _id, name, branches, setState }) => {
  return <li>{_id}</li>
}
